import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    dark: {
        backgroundColor: 'black',
    },
}));

export default function Navbar() {
    const classes = useStyles();
    return (
        <>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static" color="secondary">
                    <Toolbar>
                        <Typography
                            variant="h6"
                            component="div"
                            sx={{ flexGrow: 1 }}
                        >
                            News
                        </Typography>
                        <Link to="/Business">
                            <Button className="text-white bg-primary">
                                business
                            </Button>
                        </Link>
                        <Link to="/Entertainment">
                            <Button  className="text-white bg-dark mx-3">entertainment</Button>
                        </Link>
                        <Link to="/General" className="text-white bg-secondary">
                            <Button >general</Button>
                        </Link>
                        <Link to="/Health" className="text-white bg-dark mx-3">
                            <Button >health</Button>
                        </Link>
                        <Link to="/Science" className="text-white bg-success">
                            <Button >science</Button>
                        </Link>
                        <Link to="/Sports" className="text-white bg-dark mx-3">
                            <Button >sports</Button>
                        </Link>
                        <Link to="/Technology" className="text-white bg-danger">
                            <Button >technology</Button>
                        </Link>
                    </Toolbar>
                </AppBar>
            </Box>
        </>
    );
}
